import java.io.*;

log.info ("Hello World !!");

int a = 10 ;
int b = 20 ;
int c = a+b ;
log.info ("Result is : "+c) ;

// this is a single line comment

/*
 * This is
 * multiline comment
 */

 //log
 //context
 //testRunner

log.info testRunner.metaClass.methods*.name.unique().sort()

class Hello{

// This three variable should be defined in any class
 def log;
 def context;
 def testRunner;

// Create a contructor of the class
 def Hello(log, context, testRunner){
  this.log = log
  this.context = context
  this.testRunner = testRunner
 }

 def sayHello(String name){
  log.info ("Hello "+name);
 }

}

// Activate the class
context.setProperty("Hello", new Hello(log,context,testRunner))

// Access the class directly as both the calling and called classes are in same test step
def testStep = testRunner.testCase.getTestStepByName("Hello")

testStep.run(testRunner, context)

context.Hello.sayHello("Michael")

// Groovy - run request from same TestCase

// Get test status post run
def status = testRunner.runTestStepByName("CapitalCity")

// Convert the status to string
def result = status.getStatus().toString();

// Print the result
log.info("Test Result: "+result)

// Checking test status - PASS / FAIL
if(result == "OK"){
	log.info ("Test passed")
}else{
	log.info ("Test failed")
}

// Access the project
project = testRunner.testCase.testSuite.project;

// Access the test case
tcase = project.testSuites["TestSuite_3"].testCases["TestCase_1"];

// Access the class
hello = tcase.getTestStepByName("Hello");


hello.run(testRunner, context)

context.Hello.sayHello("Michael")

//Groovy - run request from another TestCase or TestSuite

// Access the project
project = testRunner.testCase.testSuite.project;

// Access the test case
tcase = project.testSuites["TestSuite_3"].testCases["TestCase_1"];

// Access the test step
tstep = tcase.getTestStepByName("CapitalCity");

// Get test status post run
def status = tstep.run(testRunner, context)

// Convert the status to string
def result = status.getStatus().toString();

// Print the result
log.info("Test Result: "+result)

// Checking test status - PASS / FAIL
if(result == "OK"){
	log.info ("Test passed")
}else{
	log.info ("Test failed")
}

/*
 * Run different test case other than this test case where this runner script is located 
 * otherwise it will run inside an infinite loop
  */
def tCase = testRunner.testCase.testSuite.testCases["TestCase_1"]

def prop = new com.eviware.soapui.support.types.StringToObjectMap()

runner = tCase.run(prop, false);

log.info (runner.getStatus().toString())

// Loop test cases in a test suite
def testCases = context.testCase.testSuite.getTestCaseList() 

testCases.each{
	log.info(it.name)
}

